        return a + b;
    }

    function subtractInts() public view returns(int) {
        return a - b;
    }

    function multiplyInts() public view returns(int) {
        return a * b;
    }

    function divideInts(int _a, int _b) public pure returns(int) {
        return _a / _b;
    }

}

